import React from 'react';
import Button from '@material-ui/core/Button';
import Dialog from '@material-ui/core/Dialog';
import DialogActions from '@material-ui/core/DialogActions';
import DialogContent from '@material-ui/core/DialogContent';
import DialogContentText from '@material-ui/core/DialogContentText';
import DialogTitle from '@material-ui/core/DialogTitle';
import Pengu from '../assets/oscar_found.png';
import Slide from '@material-ui/core/Slide';
import NominationList from './NominationList';

const Transition = React.forwardRef(function Transition(props, ref) {
    return <Slide direction="up" ref={ref} {...props} />;
});

export default function NominationAlertDialog({ nominations, openDialog, handleCloseDialog }) {

    const chosenNominations = nominations;

    const caca = () => {
        console.log("Nominations");
        console.log(nominations);
    };

    return (
        <div>
            <Dialog
                open={openDialog}
                onClose={handleCloseDialog}
                TransitionComponent={Transition}
                fullWidth={true}
                maxWidth='xl'
                keepMounted
                aria-labelledby="alert-dialog-title"
                aria-describedby="alert-dialog-description"
            >
                <DialogTitle id="alert-dialog-title">{"Your Nominations"}</DialogTitle>
                <DialogContent style={{}}>
                    <DialogContentText id="alert-dialog-description">
                        dis your list yo
                        {/* <img alt="Oscar the Penguin Nomination max" src={Pengu} /> */}
                    </DialogContentText>

                    <Box >
                        {/* {chosenNominations} */}
                        nominations
                    </Box>
                </DialogContent>
                <DialogActions>
                    <Button onClick={handleCloseDialog} color="primary">
                        No thanks
                   </Button>
                    <Button onClick={handleCloseDialog} color="primary" autoFocus>
                        Yes please!
                   </Button>
                </DialogActions>
            </Dialog>
        </div>
    );
}
